{
  "properties": {
    "displayName": "Sample Blueprint from Unittest",
    "targetScope": "subscription",
    "parameters": {
      "vNetName": {
        "type": "string",
        "metadata": {
          "displayName": "default vNet for this subscription.",
          "description": "default vNet created by this blueprint."
        },
        "defaultValue": "defaultPublicVNet"
      },
      "defaultLocation": {
        "type": "string",
        "metadata": {
          "displayName": "default Location",
          "description": "default location of resource created by this blueprint."
        },
        "defaultValue": "East US"
      },
      "defaultCostCenter": {
        "type": "string",
        "metadata": {
          "displayName": "default CostCenter",
          "description": "default CostCenter for this subscription."
        },
        "defaultValue": "Contoso/IT/PROD/123456"
      }
    },
    "resourceGroups": {
      "vNicResourceGroup": {
        "metadata": {
          "displayName": "virtual-network-rg",
          "description": "All virutal network should save under this resource group."
        }
      }
    }
  }
}

